import React from 'react';
import { NavLink } from 'react-router-dom';

const NavLinks = () => (
    <ul className="nav-links">
        <li>
            <a href="#">Bubbles</a>
        </li>
        <li>
            <a href="#">Bundles</a>
        </li>
        <li>
            <a href="#">About</a>
        </li>
        <li>
            <a href="#">Cart</a>
        </li>


    </ul>

);

export default NavLinks;
